import React from "react";
import PriorityBadge from "../UI/PriorityBadge";
import ThreeDot from "../UI/ThreeDot";

const TodoItem = ({ todo }) => {
  return (
    <div className="todo__item">
      <div className="todo__item-id">{todo.id}</div>
      <div className="todo__item-title">{todo.title}</div>
      <div className="todo__item-desc">
        Lorem ipsum dolor sit amet consectetur adipisicing elit. Maxime
        nesciunt, dolorem ea voluptas voluptate consectetur eum eos id! Possimus
        assumenda quo culpa illum et totam aliquam corporis doloribus excepturi
        laboriosam.
      </div>
      <div className="todo__item-priority">
        <PriorityBadge label="high" />
      </div>
      <div className="todo__item-status">
        <input type="checkbox" />
      </div>
      <div className="todo__item-dots">
        <ThreeDot />
      </div>
    </div>
  );
};

export default TodoItem;
